import React from "react";
import styles from "./human.module.css";

interface humanProps {
  id: number;
  name: string;
  email: string;
}

const Human: React.FC<humanProps> = ({ id, name, email }) => {
  return (
    <div className={styles.shoppingBox}>
      <li className={styles.frame}>
        <img src={`https://robohash.org/${id}`}></img>
        <p>{name}</p>
        <p>{email} </p>
        <button name="buy" className={styles.button}>
          buy
        </button>
      </li>
    </div>
  );
};

export default Human;
